import React from 'react';
import Header from './Header/Header'
import AppStyle from './App.css';
import Paper from './Filtres/FIltre'
import { makeStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid';
import Box from './Box/Box';
import Chart from './Chart/DoughnutChart'
import Barchart from './Chart/BarChart'
import RatingBarCahrt from './Chart/RatingBarChart'
import MaturityBarChart from './Chart/MatrityBarCahrt' 
import DenseTable from './Chart/ContrepartieTable'

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    maxWidth: '1500px',
    marginRight: 'auto',
    marginLeft: 'auto',
  },
  item: {
    minWidth: '300px',
  }
}));
export default function App() {

  const classes = useStyles();

  return (
    <div>
      <Header />

      <Grid className={classes.root} direction="row" justify="center" alignItems="center" container spacing={1}>
        <Grid item xs={12} className={classes.item}  >
          <Paper />
        </Grid>
        <Grid item xs={12} sm={10} md={5} lg={3} >
          <Box Tittle={'Classes d\'Actifs'} content={<Chart />} />
        </Grid>
        <Grid item xs={12} sm={10} md={5} lg={6} >
          <Box Tittle={'Top 5 des secteurs d\'Activités'} content={<Barchart />} />
        </Grid>
        <Grid item xs={12} sm={10} md={5} lg={3} >
          <Box Tittle={'SCR MARCHE'} />
        </Grid>
        {/* 2eme ligne*/}

        <Grid item xs={12} sm={10} md={5} lg={3} >
          <Box Tittle={'Poids par Rating'} content={<RatingBarCahrt />} />
        </Grid>
        <Grid item xs={12} sm={10} md={5} lg={6} >
          <Box Tittle={'Exposition  Geographique'} />
        </Grid>
        <Grid item xs={12} sm={10} md={5} lg={3} >
          <Box Tittle={'ESG & Carbon'} />
        </Grid>
        {/* 2eme ligne*/}

        <Grid item xs={12} sm={10} md={5} lg={3} >
          <Box Tittle={'Maturité Moyenne'} content={<MaturityBarChart/>} />
        </Grid>
        <Grid item xs={12} sm={10} md={5} lg={6} >
          <Box Tittle={'Contreparties'} content ={<DenseTable/>}/>
        </Grid>
        <Grid item xs={12} sm={10} md={5} lg={3} >
          <Box Tittle={'Risque Climatique'} />
        </Grid>
      </Grid>


    </div>
  );

}
